const createPost = () => {
  return (
    <form>
      <div class="form-group">
        <label for="exampleFormControlInput1">Title</label>
        <input type="test" class="form-control" id="exampleFormControlInput1" placeholder="Enter your title here" />
      </div>
      <div class="form-group">
        <label for="exampleFormControlTextarea1">Content</label>
        <textarea class="form-control" id="exampleFormControlTextarea1" rows="6" placeholder="Write your blog post here"></textarea>
      </div>
    </form>
  )
}

const CreatePostComponent = () => {
  return (
    <div class="container">
      <div class="row">
        <div class="col-lg-12 col-md-12 col-sm-12">
          {createPost()}
        </div>
      </div>
    </div>
  )
}

export default CreatePostComponent
